import React from 'react'
import store from '../store';
import { useSelector } from 'react-redux';

export default class User extends Component {

    constructor(props) {
        super(props);
        state = {
            firstName: "",
            lastName: "",
            isLogged: false,
        }
    }

    render() {
        return (
            <div>{useSelector(state => state.loginReducer)}</div>
    )
  }
}
